export type RawData = {
    proof_uuid: string;
    input_time: number;
    submit_time: number | null;
    stage: 'Received' | 'Aggregated' | 'Submitted' | ''; // los nodos inicialmente tienen un estado vacío
    aggregated_proofs: string[]; // list of children proof_uuid
    is_sent_to_chain: boolean; // this is always false for now
};

export type NodeData = {
    proof_uuid: string;
    height: number;
    input_time: number;
    submit_time: number | null;
    aggregated_proofs: string[]; // list of children proof_uuid
    is_sent_to_chain: boolean; // this is always false for now    
    stage: 'Received' | 'Aggregated' | 'Submitted'; // Una vez que un nodo es sacado de la lista inicial, madurará de un estado a otro
    children?: NodeData[] // Los nodos que etngan hijos representados en aggregated_proofs pasarán a tener esta propiedad para generar la estructura de árbol
};


class NodeProcessor {
    public initialList: NodeData[];
    public receivedList: NodeData[];
    public treeStructure: NodeData[];
    public submittedList: NodeData[];
    public byId: { [proof_uuid: string]: NodeData };

    constructor(data: RawData[]) {
        this.initialList = [];
        this.receivedList = [];
        this.treeStructure = [];
        this.submittedList = [];
        this.byId = {};
        this.init(data);
    }

    init(data: RawData[]) {
        const sorted = [...data].sort((a, b) => a.input_time - b.input_time);
        sorted.forEach((raw) => {
            const node = { height: 1, ...raw, stage: 'Received' } as NodeData;
            this.byId[node.proof_uuid] = node;
            this.initialList.push(node);
        });
    }

    print() {
        console.log('Initial List:',   [ ...this.initialList   ]);
        console.log('Received List:',  [ ...this.receivedList  ]);
        console.log('Tree Structure:', [ ...this.treeStructure ]);
        console.log('Submitted List:', [ ...this.submittedList ]);
    }

    public processNodes(currentTime: number) {
        const newReceievedList: NodeData[] = [];
        
        // Mover nodos desde initialList a receivedList
        this.initialList = this.initialList.filter((node: RawData) => {
            if (node.input_time <= currentTime) {
                newReceievedList.push({ ...node, stage: 'Received' } as NodeData);
                return false;
            }
            return true;
        });

        this.receivedList = [...this.receivedList, ...newReceievedList];
        console.log('NodeProcessor.processNodes() newReceievedList:', newReceievedList.map(node => node.proof_uuid));

        // de los nuevos nodos recibidos en newReceievedList vamos a sacar aquellos que tienen hijos (aggregated_proofs.length > 0)
        const newParents = newReceievedList.filter(node => node.aggregated_proofs.length > 0);
        console.log('NodeProcessor.processNodes() newParents:', newParents.map(node => ({ proof_uuid: node.proof_uuid, aggregated_proofs: node.aggregated_proofs})));


        // para iterar sobre esta lista y extraer los nodos de donde sea que estén (this.treeStructure o this.receivedList) para ponerlos en la lista de children
        const newParentsReady: NodeData[] = [];
        newParents.forEach(parent => {
            const children = [] as NodeData[];
            this.receivedList = this.receivedList.filter(received => {
                if (parent.aggregated_proofs.includes(received.proof_uuid)) {
                    // this node is a child of the parent, need to be removed from receivedList and added to children
                    const newNode = { ...received, stage: 'Aggregated' } as NodeData;
                    children.push(newNode);
                    if (newNode.submit_time) {
                        this.submittedList.push(newNode);
                    }
                    return false;
                } else if (parent.proof_uuid === received.proof_uuid) {
                    // this node is the parent, need to be removed from receivedList
                    return false;
                }
                return true;
            });

            // pueden existir nodos que estén presentes en parent.aggregated_proofs pero que estén en this.treeStructure
            this.treeStructure = this.treeStructure.filter(child => {
                if (parent.aggregated_proofs.includes(child.proof_uuid)) {
                    children.push(child);
                    if (child.submit_time) {
                        this.submittedList.push(child);
                    }
                    return false;
                }
                return true;
            });

            const aggregatedNode: NodeData = { ...parent, stage: 'Aggregated', children };
            newParentsReady.push(aggregatedNode);
            if (aggregatedNode.submit_time) {
                this.submittedList.push(aggregatedNode);
            }
        });

        this.treeStructure = [...this.treeStructure, ...newParentsReady];

        // finalmente recorremos la lista de submittedList para actualizar el estado de los nodos que ya fueron enviados a la cadena retirándolo de la lista de submittedList
        this.submittedList = this.submittedList.filter(node => {
            if (node.submit_time && node.submit_time <= currentTime) {
                node.stage = 'Submitted';
                node.is_sent_to_chain = true;
                return false;
            }
            return true;
        });

    }

    public buildTree() {
        console.log('-------- NodeProcessor.buildTree() ------');
        this.initialList.forEach(node => {
            if (node.aggregated_proofs.length > 0) {
                const parent = node;
                this.treeStructure.push(parent);
                parent.stage = 'Aggregated';
                parent.children = [];
                parent.aggregated_proofs.forEach(child_proof_uuid => {
                    const child = this.byId[child_proof_uuid];
                    if (child) {
                        child.stage = 'Aggregated';
                        parent.children?.push(child);
                    } else {
                        console.error('Node not found:', { parent, child_proof_uuid });
                    }
                });
                // el parent.parent es igual al máximo height de los children + 1
                parent.height = parent.children.reduce((maxHeight, child) => Math.max(maxHeight, child.height), 0) + 1;

                // sacamos de treeStructure todos los children que estén presentes en parent.aggregated_proofs
                this.treeStructure = this.treeStructure.filter(child => !parent.aggregated_proofs.includes(child.proof_uuid));
            }
        });        
    }
}

export type ProcessedData = {
    received: [];
    aggregated: [];
    submitted: [];
    sorted: []; // by input_time
    byId: { [key: string]: RawData };
};

export const preprocessData = (data: RawData[]): ProcessedData => {
    const received: RawData[] = [];
    const aggregated: RawData[] = [];
    const submitted: RawData[] = [];
    const sorted: RawData[] = [];
    const byId: { [key: string]: RawData } = {};

    data.forEach((node) => {
        if (node.stage === 'Received') {
            received.push(node);
        } else if (node.stage === 'Aggregated') {
            aggregated.push(node);
        } else if (node.stage === 'Submitted') {
            submitted.push(node);
        } else {
            console.error('Unknown stage:', node.stage);
        }
        byId[node.proof_uuid] = node;
    });

    sorted.push(...data);
    sorted.sort((a, b) => a.input_time - b.input_time);


    return { received, aggregated, submitted, sorted, byId } as ProcessedData;
};

